import { Component,OnInit } from '@angular/core';
import { Rapport } from '../models/rapport.model';
import { ActivatedRoute } from '@angular/router';
import { Rapportservice } from '../services/rapport.service';
import { MedecinServices } from '../services/medecin.service';
import { Medecin } from '../models/medecin.model';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-ajout-rapport',
  templateUrl: './ajout-rapport.component.html',
  styleUrls: ['./ajout-rapport.component.scss']
})
export class AjoutRapportComponent implements OnInit{
  unMedecin$!:Observable<Medecin[]>;
  unRapport$!:Observable<Rapport[]>;
  date!: string;
  motif!: string;
  bilan!: string;
  idVisiteur!: string;
  id!: string;
  messageConfirmation: string = '';

  constructor(private medecinService: MedecinServices, private route: ActivatedRoute, private rapportService: Rapportservice) {}


  ngOnInit(): void {
    const id =+ this.route.snapshot.params['id'];
    this.unMedecin$ = this.medecinService.getMedecinById(+id);
    
    const idRapport = +this.route.snapshot.params['id'];
    this.unRapport$ = this.rapportService.getRapportById(+idRapport);
  }

  onSubmit() {
    console.log(this.date);
    console.log(this.motif);
    console.log(this.bilan);
    console.log(this.idVisiteur);
    const idMedecin: string = this.route.snapshot.params['idMedecin'];
    console.log(idMedecin);
    
    this.rapportService.insertRapportById(
        this.date,
        this.motif,
        this.bilan,
        this.idVisiteur,
        idMedecin
      ).subscribe(response => {
        console.log('Rapport inséré avec succès', response);
        this.messageConfirmation = 'Le rapport a bien été enregistré.';
    }, error => {
        console.error('Erreur lors de l\'insertion du rapport', error)
        this.messageConfirmation = 'Une erreur est survenue, le rapport n\'a pas été enregistré.';
    });
    setTimeout(() => {
      
    },  this.messageConfirmation);
}

}

<div>
    <h2>Ajout de Rapport</h2>
    <div class="col-lg-4 offset-md-4 mb-3 mt-3">
        <label for="date" class="form-label">Date:</label>
        <input type="text" class="form-control" id="date" placeholder="Saisir la date (yyyy-mm-dd)" name="date" required="required" [(ngModel)]="date">
        <label for="motif" class="form-label">Motif:</label>
        <input type="text" class="form-control" id="motif" placeholder="Saisir votre motif" name="motif" required="required"[(ngModel)]="motif">
        <label for="bilan" class="form-label">Bilan:</label>
        <input type="text" class="form-control" id="bilan" placeholder="Saisir le bilan" name="bilan" required="required"[(ngModel)]="bilan">
        <label for="visiteur" class="form-label">ID du Visiteur:</label>
        <input type="text" class="form-control" id="visiteur" placeholder="Saisir l'ID du visiteur" name="visiteur" required="required"[(ngModel)]="idVisiteur">
    </div>
    <button class="btn-valider" (click)="onSubmit()">Valider</button>
    <p *ngIf="messageConfirmation" class="message">{{ messageConfirmation }}</p>
</div>
